import React from 'react';
import classes from './style.module.css'
import NavigationLink from "./NavigationLink";
import BlockFriendsContainer from "./BlockFriends/containerIndex";

const Navbar = (props) => {
    return (
        <div className="main">
           <NavigationLink />
           <BlockFriendsContainer />
        </div>
    )
}

export default Navbar;
